import store from "../redux/store";
import axios from "ax";
import * as syncActions from "./syncActions";

export const getupscquestion = dispatch => {
  axios
    .get("http://localhost:8500/upsc/getallquestions")
    .then(response => {
      console.log("sent successfully", response.data);
      store.dispatch(syncActions.getUpscQuestions(response.data));
    })
    .catch(err => {
      console.log(err);
    });
};

export const getupscSubjectQuery = (req, res) => {
  const data = { subject: req.body };
  axios
    .post("http://localhost:8500/upsc/get-subject-query", data)
    .then(response => {
      console.log("sent successfully", response.data);
      store.dispatch(syncActions.getUpscSubjectQuery(response.data));
    })
    .catch(err => {
      console.log(err);
    });
};
export const getupscYearQuery = dispatch => {
  axios
    .get("http://localhost:8500/upsc/get-year-query")
    .then(response => {
      console.log("sent successfully", response.data);
      store.dispatch(syncActions.getUpscYearQuery(response.data));
    })
    .catch(err => {
      console.log(err);
    });
};
